import React, { useRef, useState } from "react";
import { UploadIcon } from "./icons";

console.log("✅ Dashboard.js loaded");

function Dashboard() {
  const fileInputRef = useRef(null);
  const [file, setFile] = useState(null);
  const [error, setError] = useState("");
  const [loading, setLoading] = useState(false);
  const [report, setReport] = useState(null);

  const acceptedTypes = [
    "py", "js", "ts", "java", "cpp", "cs", "go", "rs", "kt", "zip", "tar.gz",
  ];

  const handleFileChange = (e) => {
    const chosenFile = e.target.files?.[0];
    if (!chosenFile) return;

    const ext = chosenFile.name.split(".").pop()?.toLowerCase() || "";
    if (!acceptedTypes.includes(ext)) {
      setError("Unsupported file type");
      setFile(null);
      e.target.value = "";
      return;
    }

    setError("");
    setFile(chosenFile);
  };

  const handleUploadClick = () => {
    fileInputRef.current?.click();
  };

  // ✅ Fetch the real report from backend
  const handleSubmit = async () => {
    if (!file) return;
    console.log("📤 Uploading file to backend…");
    setLoading(true);
    setError("");
    setReport(null);

    const formData = new FormData();
    formData.append("file", file);

    try {
      const response = await fetch("http://127.0.0.1:8000/review", {
        method: "POST",
        body: formData,
      });

      if (!response.ok) {
        throw new Error(`Server returned ${response.status}`);
      }

      const data = await response.json();
      console.log("✅ Full backend response:", data);
      setReport(data); // save full backend report
    } catch (err) {
      console.error(err);
      setError("Failed to generate report. Please try again.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="flex flex-col items-center text-center px-4 w-full max-w-3xl space-y-8">
      {/* Heading */}
      <h1 className="text-4xl md:text-5xl font-extrabold text-gray-900 drop-shadow-sm">
        Code Review Assistant
      </h1>

      {/* Upload control */}
      <div
        onClick={handleUploadClick}
        className="flex items-center w-full bg-white/90 shadow-md rounded-xl px-4 py-4 cursor-pointer border border-gray-200 hover:border-blue-400 focus-within:ring-2 focus-within:ring-blue-300 transition duration-200"
        role="button"
        aria-label="Upload your code file"
      >
        <div className="flex items-center justify-center bg-blue-100 text-blue-600 rounded-lg w-10 h-10 mr-3">
          <UploadIcon />
        </div>
        <div className="flex-1 text-left text-gray-500 truncate">
          {file ? file.name : "Upload your code file"}
        </div>
        <input
          type="file"
          accept=".py,.js,.ts,.java,.cpp,.cs,.go,.rs,.kt,.zip,.tar.gz"
          ref={fileInputRef}
          onChange={handleFileChange}
          className="hidden"
        />
      </div>

      {error && <p className="text-red-600 text-sm">{error}</p>}

      {/* Submit button */}
      <button
        onClick={handleSubmit}
        disabled={!file || loading}
        className={`w-72 h-14 text-lg font-semibold text-white rounded-full transition-all duration-300 focus:ring-2 focus:ring-offset-2 focus:ring-blue-400
          ${
            file && !loading
              ? "bg-gradient-to-r from-[#4EA7FF] to-[#0A4FBF] hover:brightness-110"
              : "bg-gray-400 cursor-not-allowed"
          }`}
      >
        {loading ? (
          <span className="flex items-center justify-center gap-2">
            <svg
              className="animate-spin h-5 w-5 text-white"
              xmlns="http://www.w3.org/2000/svg"
              fill="none"
              viewBox="0 0 24 24"
            >
              <circle
                className="opacity-25"
                cx="12"
                cy="12"
                r="10"
                stroke="currentColor"
                strokeWidth="4"
              ></circle>
              <path
                className="opacity-75"
                fill="currentColor"
                d="M4 12a8 8 0 018-8v4a4 4 0 00-4 4H4z"
              ></path>
            </svg>
            Generating…
          </span>
        ) : (
          "View Report"
        )}
      </button>

      {/* ✅ Full Report Viewer */}
      {report && (
        <div className="mt-8 w-full bg-white/95 rounded-xl shadow-lg text-left p-6 space-y-4 border border-gray-200 animate-fadeIn overflow-y-auto max-h-[70vh]">
          <h2 className="text-2xl font-semibold text-blue-600 mb-2">
            🧾 Full Code Review Report
          </h2>

          {/* Basic Info */}
          <p className="text-sm text-gray-600">
            <strong>ID:</strong> {report.id} <br />
            <strong>Status:</strong> {report.status}
          </p>

          {/* File Details */}
          {report.report?.files && (
            <div>
              <h3 className="font-semibold text-gray-800 mt-3">📂 Files</h3>
              <ul className="list-disc list-inside text-gray-700 text-sm">
                {report.report.files.map((f, i) => (
                  <li key={i}>
                    {f.filename} — {f.language}, {f.size} bytes
                  </li>
                ))}
              </ul>
            </div>
          )}

          {/* Summary */}
          {report.report?.analysis?.summary && (
            <div>
              <h3 className="font-semibold text-gray-800 mt-3">📋 Summary</h3>
              <p className="text-gray-700">
                {report.report.analysis.summary}
              </p>
            </div>
          )}

          {/* Issues */}
          {report.report?.analysis?.issues?.length > 0 && (
            <div>
              <h3 className="font-semibold text-gray-800 mt-3">⚠️ Issues</h3>
              <ul className="list-disc list-inside text-gray-700 text-sm space-y-2">
                {report.report.analysis.issues.map((issue, i) => (
                  <li key={i}>
                    <strong>{issue.severity.toUpperCase()}</strong> — Line{" "}
                    {issue.line}: {issue.message}
                    <br />
                    💡 <em>{issue.suggested_fix}</em>
                    <br />
                    <span className="text-gray-500 text-xs">
                      Confidence: {Math.round(issue.confidence * 100)}%
                    </span>
                  </li>
                ))}
              </ul>
            </div>
          )}

          {/* Suggestions */}
          {report.report?.analysis?.suggestions?.length > 0 && (
            <div>
              <h3 className="font-semibold text-gray-800 mt-3">💡 Suggestions</h3>
              <ul className="list-disc list-inside text-gray-700 text-sm">
                {report.report.analysis.suggestions.map((s, i) => (
                  <li key={i}>
                    <strong>{s.category}:</strong> {s.message}
                  </li>
                ))}
              </ul>
            </div>
          )}

          {/* Metrics */}
          {report.report?.analysis?.metrics && (
            <div>
              <h3 className="font-semibold text-gray-800 mt-3">📊 Metrics</h3>
              <pre className="bg-gray-100 p-3 rounded-lg text-sm text-gray-800 overflow-x-auto whitespace-pre-wrap">
                {JSON.stringify(report.report.analysis.metrics, null, 2)}
              </pre>
            </div>
          )}

          {/* Model Info */}
          {report.report?.analysis?.llm_metadata && (
            <p className="text-gray-500 text-xs mt-2">
              
            </p>
          )}
        </div>
      )}

      <footer className="text-sm text-white/80 mt-8">Made by Supriya</footer>
    </div>
  );
}

export default Dashboard;
